 import React from 'react'
 import { Typewriter,Cursor } from 'react-simple-typewriter'
const Home = () => {
  return (
    <>
      <video style={{width:"100%",objectFit:"cover"}}  autoPlay  loop muted >
            <source src='Video/Video.mp4' type='video/mp4'/>
      </video>
    <center>  <span className=' display-4 text-info' >
          <Typewriter
            words={['Welcome to Pakistan No.1 E-commerce website  ', 'Here we have variety of things ']}
            loop={Infinity}
            cursor
            cursorStyle='!'
            typeSpeed={90}
            deleteSpeed={50}
            delaySpeed={1000}
          />
        </span></center>
    </>
  )
}

export default Home
